import React from "react";
import Checkbox from '@material-ui/core/Checkbox';

class Row extends React.Component {

    render() {
        return (
            <div>
                <Checkbox></Checkbox>
                <h2>Este es el mensaje</h2>
            </div>
        )
    }

}

export default Row;
